import React from 'react';
import { 
    PortfolioItemContainer,
    PortfolioDescriptionContainer
} from '../portfolio-item/portfolio-item.styles';

const PortfolioItem = (props) => {
    const { descfade, descdelay, header, company, description, image, redirect } = props

    return (
        <PortfolioItemContainer>
			<PortfolioDescriptionContainer data-aos={descfade} data-aos-delay={descdelay}>
				<h6>{header}</h6>
				<h1>{company}</h1>
				<p>{description}</p>
				<a href={redirect} className="cta">View Details</a>
			</PortfolioDescriptionContainer>
			<div className="portfolio-img" data-aos={imgfade} data-aos-delay={imgdelay}>
				<img src={image} alt=""/>
			</div>	
		</PortfolioItemContainer>
    )
}

export { PortfolioItem };
